import "./GetPaid.scss";

const GetPaid = () => {
  return (
    <div className="GetPaid">
      <h1>Get paid to teach online</h1>
      <p>
        Connect with thousands of learners around the world and teach from your
        living room
      </p>
      <button>Get Started</button>
    </div>
  );
};

export default GetPaid;
